//first get the IP Address
var ip = workflow.variables.u_prefix;
//clean up the prefix
var tmp = ip.toString();
ip = tmp.split('/');
var pre = ip[0];
//calculate the reverse address
var pre_split = pre.split('.');
var reverse_ip = "";
var reverse_zone = "";
for (var i=0; i< pre_split.length; i++) {
	var index = pre_split.length-i-1;
	var index1 = pre_split.length-i-2;
	if(index>=0){
		reverse_ip += pre_split[pre_split.length-i-1] + ".";	
	}
	if(index1>=0){
		reverse_zone += pre_split[pre_split.length-i-2] + ".";
	}
}

//store the reverse address
var reverse_domain = reverse_ip + "in-addr.arpa";
reverse_zone += "in-addr.arpa";

workflow.scratchpad.reverseDomainName = reverse_domain;
workflow.scratchpad.reverseZoneName = reverse_zone;

workflow.scratchpad.reverseAnswers = '[{"answer":["'+ workflow.variables.u_domain + '"]}]';

